Description:
• recommended by Tom Lancashire;
• prescribed by Ian Grime; &
• suffered by me.

-3 jours de travail (lundi férié);
-Classé 8e au 3000m SC, et j’ai fini 4e (à 0.15sec du podium);
-Classé 16e au 1500, mais: 
-3e place en demi-finale (big Q);
-6e en finale dans une course tactique;
- 5 séances de physio;et
-Malgré que ce soit ma 10e course de la saison (extérieure), je commence [enfin] à retrouver de bonnes sensations!

A) Mon envie d’acheter de l’équipement de vélo;
B) Mon énergie le lundi à 00:00000.1 (selon Sam);
C) Mon abonnement Netflix; ou
D) Mon amour pour le popcorn
